sys_variable_value.value:
(function execute(inputs, outputs) {

  var gdt = new GlideDateTime();
  var currentMonthNumber = inputs.period;
  var lastMonths = ['3','6','9','12'];
  var isLastQmonth = !!~lastMonths.indexOf(currentMonthNumber);

  outputs.current_date = gdt;
  outputs.is_last_quarter_month = isLastQmonth;

})(inputs, outputs);

